import styles from './Input.module.css';

const Input = ({label, value, type , name, handleChange}) => {

    return <div className={styles.formControl}>
                    <div htmlFor={name}>{label}</div>
                <input id={name} type={type} value={value} onChange={handleChange}/>
            </div>            
};

export default Input;
